// src/components/Agenda.js

import React from 'react';
import './Agenda.css';

const Agenda = ({ day }) => {
  const generateTimeSlots = () => {
    const timeSlots = [];
    for (let i = 8; i <= 18; i += 2) {
      timeSlots.push(`${i}-${i + 2}`);
    }
    return timeSlots;
  };

  return (
    <div className="agenda">
      <h3>{day}</h3>
      <ul>
        {generateTimeSlots().map((timeSlot, index) => (
          <li key={index}>{timeSlot}</li>
        ))}
      </ul>
    </div>
  );
};

export default Agenda;
